import React from 'react';
import { useGLTF } from '@react-three/drei';

export default function Model({ url, onModelClick }) {
  const { scene } = useGLTF(url);

  return (
    <primitive 
      object={scene} 
      onClick={(e) => {
        e.stopPropagation();
        onModelClick(e.point);
      }}
    />
  );
}
